import React, { Component } from 'react';

export default class LoginComponent extends Component {
  render() {
    return (
      <section className="custom-card-user">
        <div className="container">
          <h1 className="d-flex justify-content-center pb-4">All Users</h1>
          {this.state.users.map((item) => (
            <div className="card" key={item.id}>
              <div className="custom-card__image">
                <img
                  src={require(`../assets/img/${item.image}`)}
                  alt={item.image}
                  className="custom-image"
                />
              </div>

              <div className="card-body">
                <h5 className="card-title">
                  {item.firstName} {item.lastName}
                </h5>
                <div className="custom-card__author pb-3">
                  <p className="custom-color">{item.place}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </section>
    );
  }
}
